import './App.css';
import React, { Component } from "react";
import Contactinfo from './components/Contactinfo';

class App extends Component {
  constructor() {
    super();

    this.state = {
      firstName: "FirstName",
      editModeEnabled: false,
      lastName: "LastName",
      phoneNumber: "1 (234) 567 8910",
      emailAddress: "your@email.com",
    };

    this.editValue = this.editValue.bind(this);


  }
  editValue = (e) => {
    this.setState({ editModeEnabled: !this.state.editModeEnabled });
    console.log(e.target)
  };

  render() {
  return (
    <div className="App">
      <Contactinfo firstName={this.state.firstName} lastName={this.state.lastName} disabled={!this.state.editModeEnabled}
      phoneNumber={this.state.phoneNumber} emailAddress={this.state.emailAddress} editValue={this.editValue}
      ></Contactinfo>
    </div>
  );
  }
}

export default App;
